<script type="text/javascript">
  window.onload = function () {
    var chart = new CanvasJS.Chart("chartContainer1",
    {
      
      animationEnabled: true,
      legend: {
        cursor:"pointer",
        itemclick : function(e) {
          if (typeof (e.dataSeries.visible) === "undefined" || e.dataSeries.visible) {
              e.dataSeries.visible = false;
          }
          else {
              e.dataSeries.visible = true;
          }
          chart.render();
        }
      },
         
      axisY: {
        title: "Dates",
        interval: 1,
      },
      
      data: [
      {        
               
        type: "bar",
        showInLegend: true,
        name: "Check in",
        color: "silver",          
        dataPoints: [
        { y: 1, label: "Monday"},
        { y: 2, label: "Tuesday"},
        { y: 3, label: "Wednesday"},        
        { y: 4, label: "Thursday"},        
        { y: 5, label: "Friday"},        
        { y: 6, label: "Saturday"}        


        ]
      },
      {        
        type: "bar",
        showInLegend: true,
        name: "Check out",
        color: "#A57164",
        dataPoints: [
        { y: 7, label: "Monday"},
        { y: 8, label: "Tuesday"},
        { y: 9, label: "Wednesday"},        
        { y: 10, label: "Thursday"},        
        { y: 11, label: "Friday"},        
        { y: 30, label: "Saturday"}    

        ]
      }

      ]
    });

chart.render();
}
</script>


